		$('.kopa-main-nav .main-menu > li').hover(function(e){
			
			$('.kopa-main-nav .main-menu > li').not(this).each(function(index, element) {
				$(this).find('a').stop(true,false).animate({opacity:0.3}, 0, "linear");
            });
			//animation picto
			$(this).find('a .picto').stop(true,false).animate({backgroundPositionY: "0px"}, 175, "linear");
