			$('.menu-actif-overlay').height($('#main-content').height());
			$('.menu-actif-overlay').stop(true,false).fadeIn("fast");
		}, function(){
			$('.kopa-main-nav li a').animate({opacity:1}, 50, "linear");
			//animation picto
			$(this).find('a .picto').stop(true,false).animate({backgroundPositionY: "50px"}, 150, "linear");
			//desactivation overlay
			$('.menu-actif-overlay').stop(true,false).fadeOut("fast");
		});
		
	}
	
